(34, 'Tallarines Verdes', 'Rodolfo', 'facil', 30, 'segundo', 'Fideos', 'Ajos', 'Espinaca', 'Albahaca', 'Cebolla', 'Pimienta', 'Queso', 'Leche', , '1- Primero pon a hervir el agua con un poco de sal y cuando esté caliente agrega la pasta hasta que quede “al dente”, el tiempo depende del tipo de pasta y la marca, pero suele ser entre 8 a 10 minutos. Ve probando hasta que esté listo.\r\n\r\n2- Mientras la pasta se cocina pon una olla con agua y cuando esté hirviendo agrega la albahaca por un minuto, luego retírala y quítale el agua.\r\n\r\n3- En una sartén con un poco de aceite fríe ligeramente las hojas de espinacas y retíralas.\r\n\r\n4-A continuación agrega 1/2 taza de aceite a la licuadora, leche evaporada, y licúa poco a poco las espinacas. Cuando hayas obtenido la crema, agrega la albahaca y licuar otra vez.\r\n\r\n5- Una vez esté toda la espinaca y la albahaca licuada agrega los dos dientes de ajo, el queso fresco, el queso parmesano, las pecanas, sal, pimienta y continua licuando hasta que obtengas la salsa.\r\n\r\n6- Ahora que ya tienes los tallarines hervidos y la salsa, sólo te queda mezclarlos. En una sartén agrega una cuchara de aceite de ');
INSERT INTO `recetas` (`id`, `nombre`, `creador`, `dificultad`, `tiempo`, `tipo_r`, `ingre1`, `ingre2`, `ingre3`, `ingre4`, `ingre5`, `ingre6`, `ingre7`, `ingre8`, `imagen`, `textpasos`) VALUES
(35, 'Papa Rellena', 'Milena', 'medio', 60, 'entrada', 'Aceituna', 'Papa', 'Carne de res', 'Pimienta', 'Huevos', 'Cebolla', 'Tomate', 'Ajos', , '1- Primero calienta una olla alta o sartén grande y agrega 2 cucharadas de aceite y la cebolla picada. Después de dos minutos agrega el ajo picado y mueve para que no se quemen. Luego agrega la carne y fríela por unos minutos.\r\n2- Cuando la carne haya reducido el agua y cambiado de color, agrega el tomate picado. Después condimenta la carne, agrega pimienta blanca, un poco de sal, un poquito de comino y orégano, ají panca y mezcla todo. Reduce el fuego y tápalo para que se termine de freír por dos minutos más o menos.\r\n3- Ahora puedes agregar las pasas. Agrega las aceitunas, los huevos duros picados, el perejil y mezcla todo.\r\n4- Hierve las papas en una olla grande. Cuando estén listas, retíralas y pélalas. Cuando estén todas peladas y todavía calientes, tienes que aplastarlas para conseguir crear una masa, puedes utilizar un prensador de papas, un aplastador o por último un tenedor.\r\n5- Ahora que ya tienes toda la papa aplastada échale un poco de sal, pimienta blanca, mezcla todo, pru');
