(36, 'Arroz con pollo', 'Stefano', 'dificil', 45, 'segundo', 'Cebolla', 'Pimiento', 'Zanahoria', 'Alverja', 'Arroz', 'Carne de pollo', 'Ajos', 'Ají amarillo', , '1- Condimenta las piezas de pollo con sal, pimienta y comino antes de freírlas. Mezcla bien para que ambos condimentos estén en todas las partes del pollo.\r\n2- Pon el aceite en una olla y cuando esté caliente agrega las piezas de pollo.\r\n3- Fríelas un poco hasta que queden un poco doradas pero no completamente. 4-Retíralas y ponlas dentro de un recipiente cubierto para que no se enfríen.\r\n5- Mientras se fríe el pollo, aprovecha para licuar el culantro. Licúa las hojas del culantro con un poco de agua y un poquito de cerveza (no demasiado líquido). Si tienes caldo de pollo lo puedes utilizar en lugar del agua y queda mejor.\r\n6- En la misma olla donde has frito las piezas de pollo agrega la cebolla, el ajo molido, el ají amarillo, el ají colorado, sal, pimienta y el cubo de caldo de pollo.\r\n7- Fríe todo durante un par de minutos hasta que la cebolla quede dorada, agrega el culantro licuado, fríe todo moviendo para que no se queme.\r\n8- Después de un minuto más o menos agrega las piezas de');
INSERT INTO `recetas` (`id`, `nombre`, `creador`, `dificultad`, `tiempo`, `tipo_r`, `ingre1`, `ingre2`, `ingre3`, `ingre4`, `ingre5`, `ingre6`, `ingre7`, `ingre8`, `imagen`, `textpasos`) VALUES
(37, 'Ají de Gallina', 'Garyn', 'medio', 45, 'segundo', 'Ají amarillo', 'Aceituna', 'Kion', 'Huevos', 'Leche', 'Carne de pollo', 'Orégano', 'Arroz', , '1- Primero hierve durante 20 minutos aproximadamente la pechuga de pollo o gallina en una olla con el apio, las hojas de laurel, la cebolla pequeña y la zanahoria.\r\n2- Una vez hervido el pollo deshiláchalo o córtalo en trozos pequeños.\r\n3- Hierve las papas con un poco de sal, pélalas y resérvalas.\r\n4- Remoja el pan o las rebanadas de pan de molde sin corteza en leche.\r\n5- Con un poco del caldo licúa las pecanas y el ajonjolí (sésamo).\r\n6- En una olla pon un poco de aceite, calienta y fríe los ajos sin que se quemen.\r\n7- Agrega la pimienta, el kión (jengibre), el orégano y el laurel. Mezcla bien y agrega las pecanas y el ajonjolí licuado.\r\n8- Agrega el ají amarillo y fríe hasta que coja un poco de color, incorpora la cebolla cortada en cuadros pequeños y cocina por 5 minutos aproximadamente o más (dependiendo de la fuerza del fuego).\r\n9- A continuación agrega el pollo deshilachado y remueve por espacio de 2 o 3 minutos para que el pollo coja un poco de sabor.\r\n10- Ahora agrega el pan re');
INSERT INTO `recetas` (`id`, `nombre`, `creador`, `dificultad`, `tiempo`, `tipo_r`, `ingre1`, `ingre2`, `ingre3`, `ingre4`, `ingre5`, `ingre6`, `ingre7`, `ingre8`, `imagen`, `textpasos`) VALUES
(38, 'Arroz con Leche', 'Ariana', 'facil', 15, 'postre', 'Arroz', 'Leche', 'Canela', 'Pasas', 'Vainita', '', '', '', , '1- Cocina en una olla el arroz con las tres tazas de agua, la canela, los clavos de olor, las pasas (opcional), la cáscara de naranja a fuego medio hasta que el arroz se haya cocido y el agua evaporado.\r\n2- Retira la cáscara de canela.\r\n3- Agrega la leche condensada, la leche evaporada y cocina a fuego lento hasta que el arroz quede en su punto.\r\n4- Justo después añade la vainilla, mezcla y cocina por cinco minutos más.\r\n5- Sirve en un recipiente y espolvorea la canela en polvo');
INSERT INTO `recetas` (`id`, `nombre`, `creador`, `dificultad`, `tiempo`, `tipo_r`, `ingre1`, `ingre2`, `ingre3`, `ingre4`, `ingre5`, `ingre6`, `ingre7`, `ingre8`, `imagen`, `textpasos`) VALUES
(39, 'Mazamorra Morada', 'Rodolfo', 'facil', 30, 'postre', 'Maiz Morado', 'Pasas', 'Membrillo', 'Manzana', 'Canela', '', '', '', , '1- Pon a hervir en una olla la piña en trocitos con la fruta seca (guindones, guindas y orejones), el azúcar y la chicha morada. Espera hasta que la fruta esté cocida.\r\n2- Luego disuelve la harina de camote y el chuño con chicha morada fría y agrega a la olla de las frutas cocidas.\r\n3- Mueve hasta que coja punto, un poco espeso. Entonces retira del fuego y agrega el jugo de 1 limón.\r\n4- Sirve en una dulcera y espolvorea con canela en polvo.');
INSERT INTO `recetas` (`id`, `nombre`, `creador`, `dificultad`, `tiempo`, `tipo_r`, `ingre1`, `ingre2`, `ingre3`, `ingre4`, `ingre5`, `ingre6`, `ingre7`, `ingre8`, `imagen`, `textpasos`) VALUES
(40, 'Tequeños', 'juan@gmail.com', 'facil', 15, 'entrada', 'Masa Wanton', 'Queso', '', 'Huevos', '', '', '', '', , '1- Para empezar corta el queso en tiras delgadas y ponlos en el centro de las masas de la masa wanton.\r\n2- Ahora bien, con los huevos batidos unta las masas de wanton alrededor del queso y envuélvelas.\r\n3- Calienta la sartén con abundante aceite.\r\n4- Una vez esté bien caliente el aceite, añade los tequeños y dóralos por ambos lados durante un par de minutos. ¡Listo, a comer!');
INSERT INTO `recetas` (`id`, `nombre`, `creador`, `dificultad`, `tiempo`, `tipo_r`, `ingre1`, `ingre2`, `ingre3`, `ingre4`, `ingre5`, `ingre6`, `ingre7`, `ingre8`, `imagen`, `textpasos`) VALUES
(41, 'Sopa de Quinua', 'Milena', 'dificil', 60, 'entrada', 'Quinua', 'Ajos', 'Tomate', 'Alverja', 'Papa', 'Choclo', 'Cebolla', 'Huevos', , '1- En una olla, coloca un chorrito de aceite, deja calentar bien y se hace un aderezo con media cucharadita de ajo molido, una cebolla cortada en pequeños cuadros, una cucharada de orégano y media cucharadita de crema de ají panca.\r\n2- Seguido, vierte una cucharadita de pasta de tomate, dos litros y medio de agua o caldo de pollo y tres cuartos de taza de quinua lavada. Deja cocina por al menos unos diez minutos.\r\n3- Pasado este tiempo, incorpora media taza de arvejas, un choclo cortado en rodajas y los doscientos cincuenta gramos de zapallo macre en pequeños cubos. Deja cocinar por aproximadamente diez minutos más.\r\n4- Luego, añade las 3 papas amarillas y deja cocinar hasta que estén bien cocidas. Una vez cocidas, retira el fuego y agrega un huevo batido, los doscientos gramos de queso fresco, una taza de leche evaporada y una cucharada de culantro picado.');

